import React, { Component } from 'react';
import Footer from '../component/footer';
import Header from '../component/header';
import "./goland.css";

class Goland extends Component{
    constructor(props){
      super(props); 
      if(props.location.state){
        this.handleChangeone = this.handleChangeone.bind(this);
        this.handleChangetwo = this.handleChangetwo.bind(this);
        this.handleChangethree = this.handleChangethree.bind(this);
        this.handleChangefour = this.handleChangefour.bind(this);
        this.handleChangefive = this.handleChangefive.bind(this);
        this.handleChangesix = this.handleChangesix.bind(this);
        console.log(props.location.state.landid)
        this.state={
          text:props.location.state.landid
        }
      }else{
        window.location.href='http://localhost:3001/'
      }
    }
    handleChangeone(e){
        let _this = this;
        _this.setState ({
            name: e.target.value
        });
    }
    handleChangetwo(e){
        let _this = this;
        _this.setState ({
            nameid: e.target.value
        });
    }
    handleChangethree(e){
        let _this = this;
        _this.setState ({
            address: e.target.value
        });
    }
    handleChangefour(e){
        let _this = this;
        _this.setState ({
            bank: e.target.value
        });
    }
    handleChangefive(e){
        let _this = this;
        _this.setState ({
            bankid: e.target.value
        });
    }
    handleChangesix(e){
        let _this = this;
        _this.setState ({
            buynum: e.target.value
        });
    }
    subBtn(){

    }
    render() {
      return  <div>
      <Header></Header>
        <div className='buyland'>
            <h3>火星第{this.state.text}号拍卖资质申请</h3>
            <div className='buylist'>
                <label>企业名称：</label><input name='name' onChange={this.handleChangeone} placeholder='如和信贷'></input>
            </div>
            <div className='buylist'>
                <label>企业注册号：</label><input name='nameid' onChange={this.handleChangetwo} placeholder='91110000094875448C'></input>
            </div>
            <div className='buylist'>
                <label>企业地址：</label><input name='address' onChange={this.handleChangethree} placeholder='北京市朝阳区建国路'></input>
            </div>
            <div className='buylist'>
                <label>开户银行：</label><input name='bank' onChange={this.handleChangefour} placeholder='招商银行北京万达支行'></input>
            </div>
            <div className='buylist'>
                <label>银行账户：</label><input name='bankid' onChange={this.handleChangefive} placeholder='110910565010908'></input>
            </div>
            <div className='buylist'>
                <label>竞标出价：</label><input name='buynum' onChange={this.handleChangesix} placeholder='一千万'></input>
            </div>
            <button onClick={this.subBtn} className="subbtn">提交</button>
        </div>
      <Footer></Footer>
      </div>
    }
}

export default Goland;
